| $1$ 日目 | $2$ 日目 | $3$ 日目 | $4$ 日目 | $5$ 日目 | $6$ 日目 | $7$ 日目 |
| :-: | :-: | :-: | :-: | :-: | :-: | :-: |
| $100$ 円 | $100$ 円 | $200$ 円 | $400$ 円 | $800$ 円 | $1600$ 円 | $10000$ 円 | 

