| 日付 | 連続購入日数 | 割引／割増 | 払う金額 |
| :-: | :-: | :-: | :-: |
| $1$ 日目 | - | - | - |
| $2$ 日目 | 連続購入 $1$ 日目 | 通常通り | $100$ 円 |
| $3$ 日目 | 連続購入 $2$ 日目 | $7$ 割引 | $60$ 円 |
| $4$ 日目 | 連続購入 $3$ 日目 | $7$ 割増 | $680$ 円 |
| $5$ 日目 | 連続購入 $4$ 日目 | $14$ 割引 | $-320$ 円 |
| $6$ 日目 | 連続購入 $5$ 日目 | $14$ 割増 | $3840$ 円 |
